import '../../../../node_modules/bootstrap/dist/css/bootstrap.min.css';
import '../../../assets/css/project/projects_common_style.css';


const Project = () =>{
    return(
        <div className="box_body" style={{color:"#fff"}}>
        <div className="project_head">
        <div className="project_inline">
            <div className="project_info">
             <span style={{fontWeight:"600"}} >Project Info</span>
            </div>
            <div className="project_more_info col-lg-12 col-md-12 col-sm-a2">
                <span className="col-lg-4"><b>Date:</b>&nbsp; 07.21.2021</span>
                <span className="category col-lg-5 "><b>Category:</b>&nbsp; Web Development</span>
                <span className="client col-lg-3 "><b>Client:</b>&nbsp; Biba Trading</span>
            </div>
        </div>
        </div>
        <div className="projects_information"> 
        <p>
            
        </p>

        </div>

    
        </div>
    )
}
export default Project;
